// HomePage.js example
import { Outlet, Link } from "react-router-dom";

function Login() {
    return (
    <>
    <h1>Login Page</h1>
    <nav>
        <ul>
            <li>
                <Link to="/">Home</Link>
            </li>
            <li>
                <Link to="/login">Login</Link>
            </li>
            <li>
                <Link to="/register">Register</Link>
            </li>
        </ul>
    </nav>

    <Outlet />

    </>
    );
  }
  
  export default Login;
